[{"location":"SpatialDE/#SpatialDE","page":"SpatialDE","title":"SpatialDE","text":"","category":"section"},{"location":"SpatialDE/","page":"SpatialDE","title":"SpatialDE","text":"spatialDE\nspatialde_param_inference\nspatialde_pvalues\nspatialde_varpars_all\nspatialde_varpars_opt\nspatialde_varpars_null\nlengthscales","category":"page"},{"location":"SpatialDE/#SpatialOmicsGPs.spatialDE","page":"SpatialDE","title":"SpatialOmicsGPs.spatialDE","text":"spatialDE(y,x::Union{RowVecs, ColVecs},n::Int; covariates = [], mean = true, names = [], lambda_tol = 1e-3)\n\nTBW\n\n\n\n\n\n","category":"function"},{"location":"SpatialDE/#SpatialOmicsGPs.spatialde_param_inference","page":"SpatialDE","title":"SpatialOmicsGPs.spatialde_param_inference","text":"spatialde_param_inference(y,x::Union{RowVecs, ColVecs},n::Int; covariates = [], mean = true, lambda_tol = 1e-3)\n\nPerform parameter inference for the SpatialDE model for all variables (columns) in y observed at locations x with a squared exponential kernel and a grid of n length scales.  The input x should be of type RowVecs or ColVecs from the KernelFunctions package.  The function returns the optimal variance parameters and length scale indices for all variables, as well as the grid of length scales used. \n\n\n\n\n\n","category":"function"},{"location":"SpatialDE/#SpatialOmicsGPs.spatialde_pvalues","page":"SpatialDE","title":"SpatialOmicsGPs.spatialde_pvalues","text":"spatialde_pvalues(minus_loglikes, minus_loglikes_null, n)\n\nCompute the p-values for the SpatialDE model for all variables given the negative log-likelihoods of the model with and without spatial structure.  The input minus_loglikes and minus_loglikes_null should be vectors with the same number of elements, and n is the number of samples.\n\n\n\n\n\n","category":"function"},{"location":"SpatialDE/#SpatialOmicsGPs.spatialde_varpars_all","page":"SpatialDE","title":"SpatialOmicsGPs.spatialde_varpars_all","text":"spatialde_varpars_all(y,x::Union{RowVecs, ColVecs},n::Int; covariates = [], mean = true, lambda_tol = 1e-3)\n\nCompute the spatial variance parameters for all variables (columns) in y observed at locations x using FaST-LMM with a squared exponential kernel and a grid of length scales.  The input x should be of type RowVecs or ColVecs from the KernelFunctions package.\n\n\n\n\n\n","category":"function"},{"location":"SpatialDE/#SpatialOmicsGPs.spatialde_varpars_opt","page":"SpatialDE","title":"SpatialOmicsGPs.spatialde_varpars_opt","text":"spatialde_varpars_opt(lσ²s, lδs, minus_loglikes)\n\nCompute the optimal spatial variance parameters and length scale index for all variables by finding for each row the minimum of the negative log-likelihood in minus_loglikes and returning the corresponding variance parameters and length scale index.  The input lσ²s and lδs should be matrices with the same number of rows as minus_loglikes and the same number of columns as the length scales used in the optimization.\n\n\n\n\n\n","category":"function"},{"location":"SpatialDE/#SpatialOmicsGPs.spatialde_varpars_null","page":"SpatialDE","title":"SpatialOmicsGPs.spatialde_varpars_null","text":"spatialde_varpars_null(y; covariates = [], mean = true)\n\nCompute the variance parameter REML estimate and corresponding negative log-likelihood for all variables in y for the null model without spatial structure.\n\n\n\n\n\n","category":"function"},{"location":"SpatialDE/#SpatialOmicsGPs.lengthscales","page":"SpatialDE","title":"SpatialOmicsGPs.lengthscales","text":"lengthscales(X, n=10)\n\nFor a vector-of-vectors X, return a grid of length scales with n grid points, logarithmically spaced.  The boundaries of the grid are by default set as the shortest observed distance between pairs of vectors in X divided by 2, and the longest observed distancebetween pairs of vectors inX` multiplied by 2.\n\nThe input X should be of type RowVecs or ColVecs from the KernelFunctions package.\n\n\n\n\n\n","category":"function"},{"location":"listfunctions/","page":"List of functions","title":"List of functions","text":"CurrentModule = SpatialOmicsGPs","category":"page"},{"location":"listfunctions/#List-of-package-functions","page":"List of functions","title":"List of package functions","text":"","category":"section"},{"location":"listfunctions/","page":"List of functions","title":"List of functions","text":"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"CurrentModule = SpatialOmicsGPs","category":"page"},{"location":"#SpatialOmics.jl-Documentation","page":"Introduction","title":"SpatialOmics.jl Documentation","text":"","category":"section"},{"location":"#Table-of-contents","page":"Introduction","title":"Table of contents","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"","category":"page"}]
